import React, {useState, useEffect} from 'react';
import {Route, Switch } from 'react-router-dom'
import axiosWithAuth from './components/axiosWithAuth'
import Login from './components/Login'
import PrivateRoute from './components/PrivateRoute'
import './App.css';
import Signup from './components/Signup';
import DinerDash from './components/Diner/DinerDash'
import {DinersListProvider} from './Contexts/DinerContext'
import TruckDetails from './components/Diner/TruckDetails'


function App() {
  const [items, setItems] = useState([]);

  useEffect(() => {
    axiosWithAuth().get('/api/trucks')
    .then(res => {
      console.log(res.data.foodTrucks)
      setItems(res.data.foodTrucks)
    })
    .catch(err =>{
      console.log(err, 'No data coming in!')
    })

  }, [])

  return (

    <DinersListProvider>
    <div className="App">
    <Switch>
    <Route path='/' exact component ={Login}/>
    <Route path='/Signup' component={Signup}/>
    <PrivateRoute path='/Diner/DashBoard' exact component={DinerDash}/>
    <PrivateRoute path='/Diner/DashBoard/truck/:id' render={() => <TruckDetails/>}/>
    </Switch>
    </div>
    </DinersListProvider>
  );
}

export default App;
